function frt_addEvent(id, relationId) {
    var _obj = $('#' + id);
    _obj.attr({
        'fill': frt_config[id].upColor,
        'fill-opacity': frt_config[id].upOpacity,
        'stroke': frt_config[id].outlineUpColor,
        'stroke-opacity': frt_config[id].outlineUpOpacity
    });
    _obj.attr({
        'cursor': 'default'
    });
    if (frt_config[id].enable == !0) {
        if (isTouchEnabled()) {
            _obj.on('touchstart', function(e) {
                var touch = e.originalEvent.touches[0];
                var x = touch.pageX + 10,
                    y = touch.pageY + 15;
                var tipw = $('#organs-tip').outerWidth(),
                    tiph = $('#organs-tip').outerHeight(),
                    x = (x + tipw > $(document).scrollLeft() + $(window).width()) ? x - tipw - (20 * 2) : x
                y = (y + tiph > $(document).scrollTop() + $(window).height()) ? $(document).scrollTop() + $(window).height() - tiph - 10 : y
                $('#' + id).css({
                    'fill': frt_config[id].overColor,
                    'fill-opacity': frt_config[id].downOpacity,
                    'stroke': frt_config[id].outlineDownColor,
                    'stroke-opacity': frt_config[id].outlineDownOpacity
                });
                bodypart = frt_config[id].hover
                $('#organs-tip').show().html(frt_config[id].hover);
                $('#organs-tip').css({
                    left: x,
                    top: y
                })
            })
            _obj.on('touchend', function() {
                $('#' + id).css({
                    'fill': frt_config[id].upColor,
                    'fill-opacity': frt_config[id].upOpacity,
                    'stroke': frt_config[id].outlineUpColor,
                    'stroke-opacity': frt_config[id].outlineUpOpacity
                });
                if (frt_config[id].target == 'new_window') {
                    window.open(frt_config[id].url)
                } else if (frt_config[id].target == 'same_window') {
                    window.parent.location.href = frt_config[id].url
                } else if (frt_config[id].target == 'modal') {
                    jQuery(frt_config[id].url).modal("show")
                }
            })
        }
        _obj.attr({
            'cursor': 'pointer'
        });
        _obj.hover(function() {
            bodypart = frt_config[id].hover
            $('#organs-tip').show().html(frt_config[id].hover);
            _obj.css({
                'fill': frt_config[id].overColor,
                'fill-opacity': frt_config[id].overOpacity,
                'stroke': frt_config[id].outlineOverColor,
                'stroke-opacity': frt_config[id].outlineOverOpacity
            })
        }, function() {
            $('#organs-tip').hide();
            $('#' + id).css({
                'fill': frt_config[id].upColor,
                'fill-opacity': frt_config[id].upOpacity,
                'stroke': frt_config[id].outlineUpColor,
                'stroke-opacity': frt_config[id].outlineUpOpacity
            })
        })
        _obj.mousedown(function() {
            $('#' + id).css({
                'fill': frt_config[id].downColor,
                'fill-opacity': frt_config[id].downOpacity,
                'stroke': frt_config[id].outlineDownColor,
                'stroke-opacity': frt_config[id].outlineDownOpacity
            })
        })
        _obj.mouseup(function() {
            $('#' + id).css({
                'fill': frt_config[id].overColor,
                'fill-opacity': frt_config[id].overOpacity,
                'stroke': frt_config[id].outlineOverColor,
                'stroke-opacity': frt_config[id].outlineOverOpacity
            });
            if (frt_config[id].target == 'new_window') {
                window.open(frt_config[id].url)
            } else if (frt_config[id].target == 'same_window') {
                window.parent.location.href = frt_config[id].url
            } else if (frt_config[id].target == 'modal') {
                jQuery(frt_config[id].url).modal("show")
            }
        })
        _obj.mousemove(function(e) {
            var x = e.pageX + 10,
                y = e.pageY + 15;
            var tipw = $('#organs-tip').outerWidth(),
                tiph = $('#organs-tip').outerHeight(),
                x = (x + tipw > $(document).scrollLeft() + $(window).width()) ? x - tipw - (20 * 2) : x
            y = (y + tiph > $(document).scrollTop() + $(window).height()) ? $(document).scrollTop() + $(window).height() - tiph - 10 : y
            $('#organs-tip').css({
                left: x,
                top: y
            })
        })
    }
}

